import React from 'react';
import Fire from '../Config/Fire'

class Home extends React.Component{

    logout(){
        Fire.auth().signOut
    }

  render() {
    return(
      <div>
        <h1>
            Welcome to zForum!
        </h1>
      </div>
    )
  }
}

export default Home;
